// Function to wait 1/60th of a second (for the current frame to finish rendering)
void wait_for_vsync() {
  volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
  int status;

  *pixel_ctrl_ptr = 1;  // starts the sync process
  // Poll the S until it becomes 0
  status = *(pixel_ctrl_ptr + 3);
  while ((status & 0x1) != 0) {
    status = *(pixel_ctrl_ptr + 3);
  }
}

// =================== HEX DISPLAY =========================
//Converts a digit to its corresponding hex segment display value
unsigned int digit_to_hex_val(unsigned int val){
  if(val==1){
    return 0x06;
  }else if(val==2){
    return 0x5B;
  }else if(val==3){
    return 0x4F;
  }else if(val==4){
    return 0x66;
  }else if(val==5){
    return 0x6D;
  }else if(val==6){
    return 0x7D;
  }else if(val==7){
    return 0x07;
  }else if(val==8){
    return 0x7F;
  }else if(val==9){
    return 0x6F;
  }else{
    //Assume 0 by default
    return 0x3F;
  }
}
void set_hex(int hexNum, unsigned int val){
  unsigned int t1 = *hex0_ptr;
  unsigned int t2 = *hex4_ptr;
  if(hexNum==0){
    *hex0_ptr = (t1 & 0xFFFFFF00)+(val);
  }else if(hexNum==1){
    *hex0_ptr = (t1 & 0xFFFF00FF)+(val << 8);
  }else if(hexNum==2){
    *hex0_ptr = (t1 & 0xFF00FFFF)+(val << 16);
  }else if(hexNum==3){
    *hex0_ptr = (t1 & 0x00FFFFFF)+(val << 24);
  }else if(hexNum==4){
    *hex4_ptr = (t2 & 0xFFFFFF00)+(val);
  }else if(hexNum==5){
    *hex4_ptr = (t2 & 0xFFFF00FF)+(val << 8);
  }
}

// ============= PS2 Controller ==============
char make_code_to_letter(unsigned int val){
    if(val==0x1C){
        return 'A';
    }else if(val==0x32){
        return 'B';
    }else if(val==0x1D){
        return 'W';
    }else if(val==0x1B){
        return 'S';
    }else if(val==0x23){
        return 'D';
    }else if(val==0x29){
        return ' '; //Space
    }else if(val==0x16) {
       return '1';
    } else if(val==0x1E) {
       return '2';
    }else{
        return '%'; //Return % by default
    }
}

int levelSelect() {
  volatile int *ps2_ptr = (int *)0xFF200100;
    int ps2_data, ps2_rvalid, ps2_input_val;
    char key_pressed;
    bool got_input = false;

    //Poll keyboard for input
    while(1){
      ps2_data = *ps2_ptr;
      ps2_rvalid = ps2_data & 0x8000;

      int pressed_val;
      if(ps2_rvalid){
        ps2_input_val = ps2_data & 0xFF;
        pressed_val = ps2_data & 0xFF;
        key_pressed = make_code_to_letter(ps2_input_val);
        //printf("Pressed: %d or %c\n", ps2_input_val, key_pressed);
        set_hex(0, digit_to_hex_val(ps2_input_val));


        //Poll until break code F0 (meaning key was unpressed)
        while(ps2_input_val != 0xF0){
          ps2_data = *ps2_ptr;
          ps2_input_val = ps2_data & 0xFF;
        }
        //Poll until value gets sent again [IDK Y]
        while(ps2_input_val != pressed_val){
          ps2_data = *ps2_ptr;
          ps2_input_val = ps2_data & 0xFF;
        }

        if (key_pressed == '1' || key_pressed == '2') {
          if (key_pressed == '1') 
            return 1;
          return 2;
        }
      }
    }
}

void switchPoll() {
   volatile int *ps2_ptr = (int *)0xFF200100;
    int ps2_data, ps2_rvalid, ps2_input_val;
    char key_pressed;
    bool got_input = false;

    //Poll keyboard for input
    while(!got_input){
      ps2_data = *ps2_ptr;
      ps2_rvalid = ps2_data & 0x8000;

      int pressed_val;
      if(ps2_rvalid){
        ps2_input_val = ps2_data & 0xFF;
        pressed_val = ps2_data & 0xFF;
        key_pressed = make_code_to_letter(ps2_input_val);
        printf("Pressed: %d or %c\n", ps2_input_val, key_pressed);
        set_hex(0, digit_to_hex_val(ps2_input_val));


        //Poll until break code F0 (meaning key was unpressed)
        while(ps2_input_val != 0xF0){
          ps2_data = *ps2_ptr;
          ps2_input_val = ps2_data & 0xFF;
        }
        //Poll until value gets sent again [IDK Y]
        while(ps2_input_val != pressed_val){
          ps2_data = *ps2_ptr;
          ps2_input_val = ps2_data & 0xFF;
        }

        if (key_pressed == ' ') {
          got_input = true;
        }
      }
    }
}

