// ============== IMPORTANT: THE FOLLOWING CODE WAS TAKEN FROM THE DE1-SoC Manual ==============
//(https://www-ug.eecg.toronto.edu/msl/handouts/DE1-SoC_Computer_Nios.pdf)
/* The assembly language code below handles Nios II reset processing */
void the_reset (void) __attribute__ ((section (".reset")));
void the_reset (void) {
  asm (".set noat"); // magic, for the C compiler
  asm (".set nobreak"); // magic, for the C compiler
  asm ("movia r2, main"); // call the C language main program
  asm ("jmp r2");
}


/* The assembly language code below handles Nios II exception processing. This code should not be
* modified; instead, the C language code in the function interrupt_handler() can be modified as
* needed for a given application. */
void the_exception (void) __attribute__ ((section (".exceptions")));
/*******************************************************************************
* Exceptions code; by giving the code a section attribute with the name ".exceptions" we allow
* the linker to locate this code at the proper exceptions vector address. This code calls the
* interrupt handler and later returns from the exception.
******************************************************************************/
void the_exception (void) {
  asm (".set noat"); // magic, for the C compiler
  asm (".set nobreak"); // magic, for the C compiler
  asm ( "subi sp, sp, 128");
  asm ( "stw et, 96(sp)");
  asm ( "rdctl et, ctl4");
  asm ( "beq et, r0, SKIP_EA_DEC"); // interrupt is not external
  asm ( "subi ea, ea, 4"); /* must decrement ea by one instruction for external
  * interrupts, so that the instruction will be run */
  asm ( "SKIP_EA_DEC:" );
  asm ( "stw r1, 4(sp)" ); // save all registers
  asm ( "stw r2, 8(sp)" );
  asm ( "stw r3, 12(sp)" );
  asm ( "stw r4, 16(sp)" );
  asm ( "stw r5, 20(sp)" );
  asm ( "stw r6, 24(sp)" );
  asm ( "stw r7, 28(sp)" );
  asm ( "stw r8, 32(sp)" );
  asm ( "stw r9, 36(sp)" );
  asm ( "stw r10, 40(sp)" );
  asm ( "stw r11, 44(sp)" );
  asm ( "stw r12, 48(sp)" );
  asm ( "stw r13, 52(sp)" );
  asm ( "stw r14, 56(sp)" );
  asm ( "stw r15, 60(sp)" );
  asm ( "stw r16, 64(sp)" );
  asm ( "stw r17, 68(sp)" );
  asm ( "stw r18, 72(sp)" );
  asm ( "stw r19, 76(sp)" );
  asm ( "stw r20, 80(sp)" );
  asm ( "stw r21, 84(sp)" );
  asm ( "stw r22, 88(sp)" );
  asm ( "stw r23, 92(sp)" );
  asm ( "stw r25, 100(sp)" ); // r25 = bt (skip r24 = et, because it was saved above)
  asm ( "stw r26, 104(sp)" ); // r26 = gp
  // skip r27 because it is sp, and there is no point in saving this
  asm ( "stw r28, 112(sp)" ); // r28 = fp
  asm ( "stw r29, 116(sp)" ); // r29 = ea
  asm ( "stw r30, 120(sp)" ); // r30 = ba
  asm ( "stw r31, 124(sp)" ); // r31 = ra
  asm ( "addi fp, sp, 128" );
  asm ( "call interrupt_handler" ); // call the C language interrupt handler
  asm ( "ldw r1, 4(sp)" ); // restore all registers
  asm ( "ldw r2, 8(sp)" );
  asm ( "ldw r3, 12(sp)" );
  asm ( "ldw r4, 16(sp)" );
  asm ( "ldw r5, 20(sp)" );
  asm ( "ldw r6, 24(sp)" );
  asm ( "ldw r7, 28(sp)" );
  asm ( "ldw r8, 32(sp)" );
  asm ( "ldw r9, 36(sp)" );
  asm ( "ldw r10, 40(sp)" );
  asm ( "ldw r11, 44(sp)" );
  asm ( "ldw r12, 48(sp)" );
  asm ( "ldw r13, 52(sp)" );
  asm ( "ldw r14, 56(sp)" );
  asm ( "ldw r15, 60(sp)" );
  asm ( "ldw r16, 64(sp)" );
  asm ( "ldw r17, 68(sp)" );
  asm ( "ldw r18, 72(sp)" );
  asm ( "ldw r19, 76(sp)" );
  asm ( "ldw r20, 80(sp)" );
  asm ( "ldw r21, 84(sp)" );
  asm ( "ldw r22, 88(sp)" );
  asm ( "ldw r23, 92(sp)" );
  asm ( "ldw r24, 96(sp)" );
  asm ( "ldw r25, 100(sp)" ); // r25 = bt
  asm ( "ldw r26, 104(sp)" ); // r26 = gp
  // skip r27 because it is sp, and we did not save this on the stack
  asm ( "ldw r28, 112(sp)" ); // r28 = fp
  asm ( "ldw r29, 116(sp)" ); // r29 = ea
  asm ( "ldw r30, 120(sp)" ); // r30 = ba
  asm ( "ldw r31, 124(sp)" ); // r31 = ra
  asm ( "addi sp, sp, 128" );
  asm ( "eret" );
}

/********************************************************************************
* Interrupt Service Routine: Determines the interrupt source and calls the appropriate subroutine
*******************************************************************************/
void interrupt_handler(void)
{
  int ipending;
  NIOS2_READ_IPENDING(ipending);
  if ( ipending & 0x1 ) // interval timer is interrupt level 0
  timer_isr();
  // else, ignore the interrupt
  return;
}
// ============== IMPORTANT: END OF CODE FROM THE DE1-SoC MANUAL (https://www-ug.eecg.toronto.edu/msl/handouts/DE1-SoC_Computer_Nios.pdf) ==============

// timer interupt service routine
void timer_isr() {
  volatile int * timer_ptr = (int *) 0xFF202000; // interval timer base address
  *(timer_ptr) = 0; // clear interrupt

  timeSeconds++; //Increment time
  
  set_hex(3, digit_to_hex_val(timeSeconds%10));
  set_hex(4, digit_to_hex_val((timeSeconds/10)&10));
  set_hex(5, digit_to_hex_val((timeSeconds/100)%10));
  if (gameActive) {
    erase_time();
    draw_time(timeSeconds);
  }
  return;
}